import { makeStyles } from '@material-ui/core/styles';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Divider from '@material-ui/core/Divider';
import Logo from '../main_ver2/logo';
import login from '../../static/login.png';

const useStyles = makeStyles((theme) => ({
    div: {
        backgroundColor: 'rgba(107, 186, 167, 0.5)',
        height: '70%',
    },
    container: {
        padding: 0,
        height:'100%',
    },
    gridContainer: {
        marginTop: theme.spacing(4),
    },
    gridItem: {
        border: 'solid',
    },
}));

export default function Login() {
    const classes = useStyles();

    return (
        <Box height={900}>
            <Logo />
            <div className={classes.div}>
                <Container className={classes.container}>
                    <Grid container direction="row" justify="center" alignItems="stretch" className={classes.gridContainer}>
                        <Grid item xs={6} className={classes.gridItem}></Grid>
                        <Grid item xs={6} className={classes.gridItem}></Grid>
                    </Grid>
                </Container>
            </div>
        </Box>
    );
}
